import React from 'react';
import ReactDOM from 'react-dom';
import mapboxgl from 'mapbox-gl/dist/mapbox-gl-csp';
import MapboxWorker from 'worker-loader!mapbox-gl/dist/mapbox-gl-csp-worker';

mapboxgl.workerClass = MapboxWorker;
mapboxgl.accessToken = 'pk.eyJ1IjoidHJtYXR0ayIsImEiOiJja210dGd2cjYwdXRzMnhzOTN1MDRsYnI2In0.OdQglh6qpMq-QQOm12p8Ng';

var currentMarkers = [];

class Map extends React.Component { // class for the map
  constructor(props) {
    super(props);
    this.state = {
      lng: -115.61, // starting coordinates
      lat: 32.67,
      zoom: 12,
      poll: 0
    };
    this.mapContainer = React.createRef();
  }

  async componentDidMount() {
    const {lng, lat, zoom} = this.state;
    const map = new mapboxgl.Map({
      container: this.mapContainer.current,
      style: 'mapbox://styles/mapbox/streets-v11',
      center: [lng, lat],
      zoom: zoom
    });

    var url = 'http://localhost:5000/' + this.state.poll // CHANGE TO CONST?
    var response = await fetch(url);
    var data = await response.json();
    var locations = data.features;

    locations.forEach(function(technician) {
      var el = document.createElement('div');
      el.className = 'marker';

      var newMarker = new mapboxgl.Marker(el)
        .setLngLat(technician.geometry.coordinates) // position
        .setRotation(technician.properties.bearing) // bearing
        .setPopup(new mapboxgl.Popup({offset: 25})
        .setText(technician.properties.name))
        .addTo(map)
      currentMarkers.push(newMarker);
    });

    this.setState({
      poll: this.state.poll + 1
    });

    console.log(this.state.poll); // DELETE BEFORE SUBMISSION

    map.on('move', () => { // get new map coordinates
      this.setState({
        lng: map.getCenter().lng.toFixed(4),
        lat: map.getCenter().lat.toFixed(4),
        zoom: map.getZoom().toFixed(2)
      });
    });
  }

  async updateLocations() {
    // get new locations from API
    var url = 'http://localhost:5000/' + this.state.poll; // CHANGE TO CONST?
    var response = await fetch(url);
    var data = await response.json();
    var locations = data.features;

    // update marker locations or add new markers
    for (let i = 0; i < locations.length; i++) {
//      if (currentMarkers[i]) {
        currentMarkers[i]
          .setLngLat(locations[i].geometry.coordinates)
          .setRotation(locations[i].properties.bearing)
//      } else {
//        var newMarker = new mapboxgl.Marker(el)
//          .setLngLat(locations[i].geometry.coordinates)
//          .setRotation(locations[i].properties.bearing)
//          .setPopup(new mapboxgl.Popup({offset: 25})
//          .setText(locations[i].properties.name))
//          .addTo(map)
//      }
    };

    this.setState({
      poll: this.state.poll + 1
    });
  }

  render() {
    const {lng, lat, zoom} = this.state;
    return (
      <div>
        <div className="sidebar">
          Longitude: {lng} | Latitude: {lat} | Zoom: {zoom}
        </div>
        <button className="poll-button" onClick={() => this.updateLocations()}>
          Update
        </button>
        <div ref={this.mapContainer} className="map-container" />
        </div>
    );
  }
}

function haversineDist(loc1, loc2) { // calculate Haversine distance between two GPS points
  const earthRadiusFt = 20902259

  const latDist = (loc1[0] - loc2[0]) * Math.PI / 180;
  const lonDist = (loc1[1] - loc2[1]) * Math.PI / 180;

  const lat1 = loc1[0] * Math.PI / 180;
  const lat2 = loc2[0] * Math.PI / 180;

  const a = (Math.sin(latDist / 2) ** 2) +
            (Math.sin(lonDist / 2) ** 2) *
            (Math.cos(lat1) * Math.cos(lat2));
  const c = 2 * Math.atan2(Math.sqrt(a), Math.sqrt(1 - a));
  return earthRadiusFt * c;
}

